### What is `useEffect`?

`useEffect` is a hook in React that allows you to perform side effects in function components. Side effects can include data fetching, setting up subscriptions, and manually changing the DOM in React components. It runs after the component renders and can be configured to run only when certain values change.

### Basic Syntax

```jsx
useEffect(() => {
  // Your side effect code here
}, [dependencies]);
```

- **Effect Function**: The first argument is a function that contains the side effect logic.
- **Dependencies Array**: The second argument is an array of dependencies. The effect will only re-run if one of the dependencies has changed.

